import Post from './post'
import styles from './postlist.module.css'

const PostList = ({ info }) => {
  return (
    <>
      {' '}
      <div className={styles.list}>
        {info.map((el) => (
          <Post
            key={el.id}
            image={el.image}
            categories={el.categories}
            postDate={el.postDate}
          ></Post>
        ))}
      </div>
    </>
  )
}

export default PostList
